import React, {useEffect,} from "react";
import Gif from "./Gif";

export default function ListOfGifs({ gifs }) {
    return gifs.map(({ title, id, url }) =>
        <Gif
            key={id}
            title={title}
            url={url}
            id={id}
        />
    )
}
